INSERT INTO `procedures` VALUES (1,'Insulin blood level',0,'The insulin concentration in the blood is an important indicator of diabetes.Ontological description: abnormal circulating insulin level [MP:0001560]; increased circulating insulin level [MP:0002079]; decreased circulating insulin level [MP:0002727].'),(2,'Electrocardiogram (ecg)',1,'To provide a high throughput method to obtain Electrocardiograms in a conscious mouse or an anesthetized mouse.'),(3,'Gross pathology and tissue collection',1,''),(4,'Histopathology',0,''),(5,'Welfare observations',0,'The Welfare Observations procedure is used for the recording of welfare issues as and when they occur.'),(6,'Gross morphology embryo e9.5',0,''),(7,'Housing and husbandry',0,'Housing_and_husbandry'),(8,'Hematology',1,'Hematological assessment of blood determines blood cell counts (white blood cells red blood cells hemoglobin and platelets) and additional hematological parameters (hematocrit mean cell volume mean corpuscular hemoglobin mean cell hemoglobin concentration) can be derived using these indices. These tests will indicate abnormalities in the production of blood and its components (blood cells and hemoglobin) as well as in the associated blood-forming organs.&nbsp;Ontological description: MP:0002429 - abnormal blood cell morphology/development.'),(9,'Formalin test',0,''),(10,'Fertility of homozygous knock-out mice',1,'To assess the fertility of homozygous knockout mice.'),(11,'Combined shirpa and dysmorphology',1,'SHIRPA and dysmorphology were originally always separate assessments.&nbsp; However they have recently been combined as assessments so that they take place at the same time.The purpose of the assessments is to examine mice for obvious physical characteristics behaviors and morphological abnormalities.Descriptions include abnormal locomotion/appearance/behavior/reflex reactions.'),(12,'Fear conditioning',0,'Fear Conditioning test assesses aversive learning and memory'),(13,'X-ray',1,'Construct and analyse digital X-ray images in immobilised mice using a Faxitron X-Ray system or NTB digital X-ray scanner.'),(14,'Viability e12.5 secondary screen',0,''),(15,'Gross morphology embryo e12.5',0,''),(16,'Opt e9.5',0,''),(17,'Y-maze',0,'Y-maze assesses learning and memory; it can be used instead/in parallel of Fear Conditioning'),(18,'Light-dark test',0,'Light-Dark test monitors the anxiety-related behaviour of mice'),(19,'Gross morphology embryo e14.5-e15.5',0,''),(20,'Acoustic startle and pre-pulse inhibition (ppi)',1,''),(21,'Embryo lacz',0,''),(22,'Microct e14.5-e15.5',0,''),(23,'Gross morphology embryo e18.5',0,''),(24,'Microct e9.5',0,''),(25,'Clinical chemistry',1,''),(26,'Adult lacz',0,''),(27,'Viability e14.5-e15.5 secondary screen',0,''),(28,'Eye morphology',1,'To detect abnormalities in eye morphology.'),(29,'Immunophenotyping',1,'Immunophenotyping of immune system cells'),(30,'Viability primary screen',1,'Assess the viability of mutant mice of each sex and zygosity.'),(31,'Indirect calorimetry',0,''),(32,'Heart weight',1,'To evaluate cardiac size using heart weight and body weight.'),(33,'Housing and husbandry',0,''),(34,'Viability e18.5 secondary screen',0,''),(35,'Microct e18.5',0,''),(36,'Electrocardiogram (ecg)',1,'To provide a high throughput method to obtain Electrocardiograms in a conscious mouse.'),(37,'Experimental design',0,''),(38,'Tissue embedding and block banking',0,'Collect and fix a standard list of tissues from the complete necropsy (see IMPC Gross Pathology &amp; Tissue Collection SOP)Trim the fixed tissues into cassettes for processingEmbed the tissues in paraffin in a standard orientation'),(39,'Open field',1,'The Open Field test is used to assess anxiety and exploratory behaviors. It is based on the natural tendency of an animal to explore and to protect itself using avoidance which translates to a normal animal spending more time in the periphery of the Open Field arena than in the center (the most anxiogenic area).'),(40,'Intraperitoneal glucose tolerance test (ipgtt)',1,''),(41,'Echo',0,'To assess the functionality of the heart in order to determine the presence of a mutant phenotype.'),(42,'Gross morphology placenta e9.5',0,''),(43,'Challenge whole body plethysmography',0,''),(44,'Experimental design',0,'experimental_design'),(45,'Gross morphology placenta e12.5',0,''),(46,'Organ weight',0,'Organ weights from different tissues collected for IMPC'),(47,'Microct e14.5-e15.5 analysis',0,''),(48,'Auditory brain stem response',1,'Auditory brainstem response test determines hearing sensitivity and other physiological parameters using evoked potential recordings in anesthetized mice.Ontological description: MP:0004738 - abnormal brainstem auditory evoked potential.'),(49,'Body weight',1,''),(50,'Body composition (dexa lean/fat)',1,'Measure bone mineral content and density as well as body composition in mice using the DEXA (Dual Energy X-ray Absorptiometry) analyser.'),(51,'Gross morphology placenta e14.5-e15.5',0,''),(52,'Viability primary screen',1,''),(53,'Viability e9.5 secondary screen',0,''),(54,'Grip strength',1,''),(55,'Gross morphology placenta e18.5',0,'');
